import React, { Fragment } from 'react';
import classes from './Home.module.css'
import video from '../../media/video.mp4'
const Home = () => {
  return (
    <Fragment>

        <div className={classes['main-display']}>
        <video loop autoplay muted>
            <source src={video} type='video/mp4'/>
        </video>
        </div>

    </Fragment>
  );
};

export default Home;
